import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';

function Home() {

  return (
    <body className='App-body'>
      <Container>
        <h1>Home</h1>
      </Container>
    </body>
  );
}

export default Home;
